import React from 'react';
import ReactTyped from 'react-typed'; // Make sure to import ReactTyped

const MyHeader = () => {
  return (
    <header className="text-center py-8">
      <h1 className="text-5xl font-bold">
        <h2 className="">let's get you back <br /></h2>
        <ReactTyped strings={["on track"]} typeSpeed={100} loop={false} />
      </h1>
    </header>
  );
};

export default MyHeader;
